http://mathworld.wolfram.com/OrientedGraph.html
*/
pred oriented {
	all n1,n2:Node | n1->n2 in adj implies n2->n1 not in adj
}

/*
The graph is acyclic, ie, contains no directed cycles.
http://mathworld.wolfram.com/AcyclicDigraph.html
*/
